import React from 'react';
import './Tile.css';
import getAnime from '../utils';

/*  should take in props to customize a given tile
 *    picture
 *    anime title
 *    (MAYBE) genre / other info?
 *    haveAddToWishList button (which would be false when used in WishListPage)
 */

export default function Tile( {name} ) {

  return (
    <div className='tile' style={{borderRadius: '10px'}}>
      <h2>
        {name}
      </h2>
      <img
        src={getAnime.image}
        alt='No Image Available'
        height={150}
        width={150}
      />
    </div>
  )
}
